INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("お！\nあそこに困ってそうな人発見！", 0, 0, 1, 1, 1.4, 0, 1, "春咲 ひより", 1001, 0, 2, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("大切な人を\n守れるようになりたい…って", 0, 0, 1, 1, 1.4, 0, 1, "草野 優衣", 1002, 0, 2, "みんなみたいに\nわたしも強くならなきゃ", "わ、わたし、\nなに言ってるんだろ\nあはは…", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("キミに必要な集中力と感性が", 0, 0, 1, 1, 1.4, 0, 1, "士条 怜", 1003, 0, 2, "フェンシングを始めてみては？", "少しは磨かれると思いますよ。", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("今日はなにして遊ぶ？", 0, 0, 1, 1, 1.5, 0, 1, "穂高 みそぎ", 1004, 0, 2, "ねぇ、にいちゃん！", "みそぎはねぇ、\nかくれんぼやりたい！", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("ねぇ…", 0, 0, 1, 1, 1.4, 0, 1, "風宮 あかり", 1006, 0, 2, "風宮あかりです", "私といっしょに…\nいかない？", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("プリンたべたいのー", 0, 0, 1, 1, 1.5, 0, 1, "出雲 宮子", 1007, 0, 2, "出雲宮子なのー", "食べ物の恨みは怖いのー", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("キミもボクの美貌に\n吸い寄せられたんだね。", 0, 0, 1, 1, 1.4, 0, 1, "虹村 雪", 1008, 0, 2, "ボクは虹村雪。", "いいよ。\n見られることは運命さ…", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 0, 1, 1, 1.4, 0, 1, "柊杏奈", 1009, 0, 2, "フッ…聞いて後悔するがいい！", "人呼んで「疾風の冥姫」!!", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 0, 1, 1, 1.5, 0, 1, "姫宮 真歩", 1010, 0, 2, "マホマホ王国のプリンセス、\nまほ姫どす", "ほんまおおきにやわ～♪", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("生き別れたお兄ちゃんを探して\n三千世界！", 0, 0, 1, 1, 1.4, 0, 1, "衣之咲 璃乃", 1011, 0, 2, "衣之咲璃乃です！", "ここで会ったが\n100年目～！", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("ち、超能力って…\n何のことかな～？", 0, 0, 1, 1, 1.4, 0, 1, "柏崎 初音", 1012, 0, 2, "私はハツネ、\n結構強いんだよ。\nきらーん☆", "…って、お願い！\n誰にも言わないでおいて～！", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("一応カリスマ読モJKやってまっす！", 0, 0, 1, 1, 1.4, 0, 1, "美波 鈴奈", 1016, 0, 2, "ちょす！\n美波鈴奈だよ～♪", "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("東京は遊園地みたいなところさー", 0, 0, 1, 1, 1.4, 0, 1, "喜屋武 香織", 1017, 0, 2, "はいたーい。\n喜屋武香織さー。", "でも、沖縄もとってもいいとこさー", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("先生って呼ばれるのは\nくすぐったいから", 0, 0, 1, 1, 1.4, 0, 1, "支倉 伊緒", 1018, 0, 2, "支倉伊緒です。", "イオちゃんって呼んでね。", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("あ！/\お兄ちゃ～ん\nまってよ～", 0, 0, 1, 1, 1.5, 0, 1, "茜 ミミ", 1020, 0, 2, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", "ミミをおいてかないでぇ～", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("あの……\nふぇ……", 0, 0, 1, 1, 1.5, 0, 1, "栗林 くるみ", 1021, 0, 2, "あ…あの…えっと…\n栗…林…くるみ…です……", "ふぇぇぇぇぇん……", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("こんな私に貴重な時間を\n割いていただき、", 0, 0, 1, 1, 1.4, 0, 1, "風宮 より", 1022, 0, 2, "風宮よりです。\nあああああ！", "なんてありがとうございます！", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("おにいちゃんどこいくの？\nえ？", 0, 0, 1, 1, 1.5, 0, 1, "北条 綾音", 1023, 0, 2, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", "私こっち行きたいー\nね、早く早くー", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("ふ、不束者ですが\nどうぞ末永く…って、", 0, 0, 1, 1, 1.4, 0, 1, "天野 すずめ", 1025, 0, 2, "わっ…わっ…私、\n天野すずめといいます！", "これて何か違う…\nあああすみません！", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("あなたは…運命の……\n伴侶……", 0, 0, 1, 1, 1.4, 0, 1, "倉石 恵理子", 1027, 0, 2, "……クスクス…私は\n…倉石恵理子……", "離しませんわ………\n絶対に…!!", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 0, 1, 1, 1.4, 0, 1, "佐々木 咲恋", 1028, 0, 2, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", "…そうでしょ？？", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("ぇっと…\nキミ、私のこと知らないの?!", 0, 0, 1, 1, 1.4, 0, 1, "桜井 望", 1029, 0, 2, "桜井望だよ！\nよろしくねっ", "あはは、\n私もまだまだだなぁ～", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("初めまして、\n私はニノン・ジュベール申すデス！", 0, 0, 1, 1, 1.4, 0, 1, "ニノン・ジュベール", 1030, 0, 2, "デケデケデンっ！", "ショーグン、\nワタシと一緒に天下統一デース！", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("でもって私の隣にいるのが……\nえ、見えない？", 0, 0, 1, 1, 1.4, 0, 1, "上喜 しのぶ", 1031, 0, 2, "上喜しのぶです。\n手元のドクロが父です。", "おかしいですね……", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("けんども\nそれには足りないモンが…", 0, 0, 1, 1, 1.5, 0, 1, "野戸まひる", 1033, 0, 2, "目指すはビッグな\nお笑い芸人だっぺ！", "そう、\nオラのボケに突っ込める相方が…！", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("ちょっと緊張しちゃって…", 0, 0, 1, 1, 1.4, 0, 1, "綾瀬 ゆかり", 1034, 0, 2, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", "ちょ\nちょっと一杯飲んできます…！", 0);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("知らない人とは話しちゃいけないので", 0, 0, 1, 1, 1.5, 0, 1, "氷川 鏡華", 1036, 0, 2, "氷川鏡華…です", "これ以上お話しすることは…\nないです！", 0);
